  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:36.539034\",\n\t\"name\": \"medicine-lake-national-wildlife-refuge-northeastern-montanan-wetlands-district-lamesteer-n-75a93\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Medicine
  Lake NWR, Northeast Montana WMD, Lamesteer NWR outlines Refuge accomplishments during
  the 1986 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. The report includes a planning section which discusses management
  planning, public participation, and research and investigations. Refuge administration
  is outlined; information about personnel, funding, and safety is given. Habitat
  management is also covered; subjects include wetlands, croplands, grasslands, grazing,
  and wilderness areas. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
  raptors, game mammals, fisheries resources, scientific collections, animal control,
  marking and bird banding, and disease control. The public uses of the Refuge described
  in this report include interpretive programs, hunting, fishing, trapping, wildlife
  observation, outdoor recreation, and law enforcement. The equipment and facilities
  section of the report provides information about new construction, rehabilitation,
  major maintenance, equipment replacement, and energy conservation. Items of interest
  are provided at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
